import Grid from '@material-ui/core/Grid';
import React from 'react';
import {StyleSheet, View} from 'react-native';
import CardSection2 from './components/card_section2';
import CardSection3 from './components/card_section3';
import Header from './components/headerV';
import LineChartV from './components/LineChart';
import NavbarV from './components/Navbar';
import SmallCardLayout from './components/SmallCardLayout';
import TimeLineV from './components/timelineV';

const lineChartData:any =  {

  "height":100,
  "labels": ["January", "February", "March", "April", "May", "June", "July"],
  "datasets": [
    {
      "label": "First dataset",
      "fill": true,
      "lineTension": 0.4,
      "backgroundColor": "rgba(225, 204,230, .3)",
      "borderColor": "rgb(205, 130, 158)",
      "borderCapStyle": "butt",
      "borderDash": [],
      "borderDashOffset": 0.0,
      "borderJoinStyle": "miter",
      "pointBorderColor": "rgb(205, 130,1 58)",
      "pointBackgroundColor": "rgb(255, 255, 255)",
      "pointBorderWidth": 0,
      "pointHoverRadius": 5,
      "pointHoverBackgroundColor": "rgb(0, 0, 0)",
      "pointHoverBorderColor": "rgba(220, 220, 220,1)",
      "pointHoverBorderWidth": 2,
      "pointRadius": 1,
      "pointHitRadius": 10,
      "data": [65, 40, 80, 81, 56, 55, 40]
    },
    {
      "label": "Second dataset",
      "fill": true,
      "lineTension": 0.4,
      "backgroundColor": "rgba(184, 185, 210, .3)",
      "borderColor": "rgb(35, 26, 136)",
      "borderCapStyle": "butt",
      "borderDash": [],
      "borderDashOffset": 0.0,
      "borderJoinStyle": "miter",
      "pointBorderColor": "rgb(35, 26, 136)",
      "pointBackgroundColor": "rgb(255, 255, 255)",
      "pointBorderWidth": 0,
      "pointHoverRadius": 5,
      "pointHoverBackgroundColor": "rgb(0, 0, 0)",
      "pointHoverBorderColor": "rgba(220, 220, 220, 1)",
      "pointHoverBorderWidth": 2,
      "pointRadius": 1,
      "pointHitRadius": 10,
      "data": [28, 48, 40, 19, 86, 27, 90]
    }
  ]
  }


const Mystyle={
  backgroundColor:{
    backgroundColor:'#eee'
  },
  chartstyle:{
    backgroundColor:'white',

    marginLeft:'65px',
    borderRadius:'5px',
    padding:'10px',

  },
  timeline :{
    borderRadius:'5px'
  },
  containerPos:{
    marginLeft:"-45px"
  }
}


function DashboardV() {
  return (
    <View style={StyleSheet.flatten([Mystyle.backgroundColor])}>
      <Header/>

      <Grid container  >
        <Grid item xs={12} sm={9} md={1}>
        <Grid item xs={12} sm={9} md={3} >
        <NavbarV/>
        </Grid>
        </Grid>
        <Grid item xs={12} sm={9} md={11} style={StyleSheet.flatten([Mystyle.containerPos])} >
        <Grid container  >
        <Grid item xs={11} sm={9} md={12} style={StyleSheet.flatten([Mystyle.backgroundColor])}>
        <SmallCardLayout/>
      </Grid>
      <Grid container style={{marginLeft:"40px"}}>
      <Grid  item xs={11} sm={9} md={3} style={StyleSheet.flatten([Mystyle.timeline])}>
      <TimeLineV/>

      </Grid>
        <Grid item xs={11} sm={9} md={8} style={StyleSheet.flatten([Mystyle.chartstyle])}>
      <LineChartV
      lineChartData={lineChartData}
      />
      </Grid>
      </Grid>
      <Grid item xs={12} sm={9} md={8} >

      <CardSection2/>
      </Grid>

    <Grid item xs={12} sm={9} md={12}>
      <CardSection3/>
    </Grid>

     </Grid>

      </Grid>
          </Grid>
</View>
  );
}
export default DashboardV;
